import React, { Component } from "react";
import MNavbar from "../Components/MNavbar.js";
import Footer from "../Components/Footer.js";
import Table1 from "../Components/Table1.js";
import Login from "../Components/Login.js";
import personNotes from "../assets/personNotes.jpg";
import ColorBar from "../Components/ColorBar.js";
import "../Components/ColorBar.css";
import "../Components/Footer.css";
import "./Home.css";

export default class Home extends Component {
  render() {
    return (
      <div>
        <ColorBar />
        <MNavbar />
        <div className="container">
          <h2 style={{ color: 'white', background: '#00274c' }}>Welcome to NoteFinder at NDNU!</h2>
          <h2 style={{ padding: "10px 20px", textAlign: "center", color: "white"}}>ToDo</h2>
          <div className="PLogo  float-left">
            <img src={personNotes} width="500" height="325" r />
          </div>
          <Login />
          <Table1 />
        </div>
        <Footer />
      </div>
    );
  }
}
